class Solution:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        max_len, i, j, chars = 0, 0, 0, []
        slen = len(s)
        while i < slen and j < slen:
            ch = s[j]
            if not ch in chars:
                chars.append(ch)
                j += 1
                max_len = max(max_len, j - i)
            else:
                chars.remove(s[i])
                i += 1
        return max_len

